import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first product card's "Add to Cart" button to be visible
    // Try to select the first .add-to-cart button inside a .product-card
    await page.waitForSelector('.product-card .add-to-cart', { timeout: 5000 });

    // Get the first product card's title for verification
    const firstProductTitle = await page.$eval('.product-card .product-title', el => el.textContent.trim());

    // Click the first "Add to Cart" button
    const addToCartButtons = await page.$$('.product-card .add-to-cart');
    if (addToCartButtons.length === 0) throw new Error('No Add to Cart button found');
    await addToCartButtons[0].click();

    // Wait for the notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_to_cart.png'));

    // Open the cart (click on the .cart element)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot of the cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal.png'));

    // Extract the product title from the cart modal to verify it was added
    let cartProductTitle = '';
    try {
      cartProductTitle = await page.$eval('#cartModal .cart-item-title', el => el.textContent.trim());
    } catch (e) {
      cartProductTitle = '';
    }

    // Extract cart count from the cart icon
    let cartCount = '';
    try {
      cartCount = await page.$eval('#cartCount', el => el.textContent.trim());
    } catch (e) {
      cartCount = '';
    }

    return {
      success: true,
      action: "Added the first product to cart and verified its presence in the cart modal",
      extractedData: {
        firstProductTitle,
        cartProductTitle,
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
